import React, { Component } from "react";
import Col from "react-bootstrap/Col";

const NationalCard = ({ fechaSorteo, numero, serie, fraccion }) => {
  return (
    <Col className="coaster-card" md={6}>
      <h4>Sorteo {fechaSorteo} </h4>
      <p> Número: {numero} </p>
      <p> Serie: {serie} </p>
      <p> Fracción: {fraccion} </p>
      <p> S: {fraccion} </p>
    </Col>
  );
};

export default NationalCard;
